import React from "react";
import './submit.css';

const EmptyPopup = ({ onClose, res }) => {
  let imageSource1,imageSource2,imageSource3,imageSource4,imageSource5;

  if (res === "peach_bact") {
    imageSource1 = "peach_bact_image.jpg";
    imageSource2 = ""
  }

   else if (res === "apple_bact") {
    imageSource1 = "apple_bact_image.jpg";
  }

   else if (res === "orange_bact") {
    imageSource1 = "orange_bact_image.jpg";
  }
   else if (res === "banana_bact") {
    imageSource1 = "banana_bact_image.jpg";
  }
   else {
    imageSource1 = "default_image.jpg";
  }
  
  return (
    <div className="popup-overlay popup-overla " style={{color:'white'}}>
      <div className="popup-content popup-conten">
        <div className="popup-header popup-heade">
          <h3></h3>
        </div>
        <div className="popup-body popup-bod">
      <p>    <p>
            Result: {res}
          </p>
          <img src={imageSource1} alt="Result Image" />
          <img src={imageSource2} alt="Result Image" />
          <img src={imageSource3} alt="Result Image" />
          <img src={imageSource4} alt="Result Image" />
          <img src={imageSource5} alt="Result Image" />
          </p>
        </div>
        <div className="popup-footer popup-foote ">
          <button className="btn btn-primary" onClick={onClose}>
            Cancel
          </button>
        </div>
      </div>
    </div>
  );
};

export default EmptyPopup;
